import React from "react";

import Navigation from "./Navigation";
import { Row,Col } from "react-bootstrap";
import "./Styles.css"

const Secondpage = () => {
    return (
        <>
            <Navigation />
            <Row>
               <Col xs={6} className = "fontstylings"></Col>
               <Col xs={6} className = "fontstyle2"></Col>
               <Col xs={6} className = "fontstylings">This is first column 2</Col>
               <Col xs={6} className = "fontstyle2">This is second column 2</Col>
            </Row>


            <p>
                This is the second page
            </p>

        </>
    )
}

export default Secondpage
